import React from 'react';
import { useNavigate } from 'react-router-dom';

function IndexPage() {
  const navigate = useNavigate();

  const goToLogin = () => {
    navigate('/login');
  };

  const goToSignup = () => {
    navigate('/signup');
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <h1 className="text-4xl font-bold mb-8">Welcome to HistoricalWeb</h1>
      <div className="flex space-x-4">
        <button 
          className="px-6 py-2 bg-blue-500 text-white font-semibold rounded-lg hover:bg-blue-700"
          onClick={goToLogin}
        >
          Login
        </button>
        <button 
          className="px-6 py-2 bg-green-500 text-white font-semibold rounded-lg hover:bg-green-700"
          onClick={goToSignup}
        >
          Signup
        </button>
      </div>
    </div>
  );
}

export default IndexPage;
